{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.4.0"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":7746251,"sourceType":"datasetVersion","datasetId":1041311}],"dockerImageVersionId":30749,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/aliciacrisp/fitbit-data?scriptVersionId=227283397\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# Bellabeat Case Study","metadata":{}},{"cell_type":"markdown","source":"Author: Alicia Crisp\n\nThis case study is part of the Google Data Analytics Certification. \n\nThe customer is Bellabeat, a pioneer in the fem-tech realm, Bellabeat is a women’s wellness company that has helped millions of women track their cycle, pregnancies, and live more in sync with their cycles. \n\nStakeholders: Urška Sršen: Co-Founder and Creative Director,  Sando Mur: Co-Founder and Key Leader\n\nThe goal of this analysis is to examine datasets from the Fitbit Fitness Tracker Data and use it to identify growth opportunities for Bellabeat as they look to expand into the global market.\n\n","metadata":{},"attachments":{"5ef6489b-d54a-4d73-bbbb-46ea50820380.png":{"image/png":""},"5b37b5c1-14db-4fcc-bd88-33b918022e69.png":{"image/png":""},"672812d1-c616-49ce-8e42-302341443197.png":{"image/png":""},"3a720777-e57b-4f53-ada5-5792b0941a6e.png":{"image/png":""},"51298148-5173-4269-ad39-c556e1aff5e4.png":{"image/png":""},"76e1b68c-2517-4b98-9d0d-1bab2ab52101.png":{"image/png":""},"b8514373-5d23-4e7c-8342-1182f053ba34.png":{"image/png":""},"36c54191-16ca-42b3-90e2-79f9cbfdf5bc.png":{"image/png":""}}},{"cell_type":"markdown","source":"# Bellabeat Current Product Lineup\n\nThe Bellabeat App, which provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits.\n\nThe Bellabeat Leaf , a wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n\nThe Bellabeat Time , a wellness watch that combines the look of a classic timepiece with smart technology to track user activity, sleep, and stress. \n\nThe Bellabeat Spring, a smart water bottle that tracks daily water intake using smart technology to ensure users that they are appropriately hydrated throughout the day.\n","metadata":{}},{"cell_type":"markdown","source":"# Deliverables for this Assignment:\n1.\tA Summary of the Business Task\n2.\tA Summary of the Data Sets Used\n3.\tDocumentation of Data Cleaning \n4.\tA Summary of my Analysis\n5.\tKey Points and Visuals\n6.\tFinal Recommendations Based on Analysis\n7.  Conclusions\n","metadata":{}},{"cell_type":"markdown","source":"# A Summary of the Business Task\nThe task assigned is to examine the suggested data set, the Fitbit Fitness TrackerData, and then determine:\n\nWhat are some trends in smart device usage?\n\nHow could these trends apply to Bellabeat customers?\n\nand How could these trends help influence Bellabeat marketing strategy?\n \n","metadata":{}},{"cell_type":"markdown","source":"# A Summary of the Data Set Used\nThe data source used for this case study is the FitBit Fitness Tracker Data. This dataset is stored within Kaggle and is made available through Mobius. \n\nAlthough the dataset comes from Fitbit, which is a reliable and credible source, it is limited in usefulness due to its small sample size, limited scope of recording, and incomplete data. The data was collected from 35 users, but is not consistently tracked for the majority of them especially with the weight and BMI related data. There is no information about the height, calories consumed, age, gender, lifestyle trends, or other data about the participants that would have made the existing data relevant to the target audience of Bellabeat, which is primarily female. No period tracking data is included in this dataset.\n\nIn addition to its, small sample size, the data was collected over a very brief period of time. The total collection time is only two months which is not enough to reflect seasonal trends. The dataset is older, being collected in 2016. A newer dataset would be useful in identifying current trends. In addition, the sleep data was only available in 4/12/2016 to 5/12/2016. \n\nIn conclusion, while the dataset offers some useful insights into smart device users’ habits, the limitations caused by its age, small sample size and lack of demographic information need to be considered when drawing conclusions or making recommendations that affect the future growth of Bellabeat.\n","metadata":{}},{"cell_type":"markdown","source":"# Documentation of Data Cleaning\nThere are two sets of data available. One is dated 03-12-2016-04-11-2016 and the other is dated 04-12-2016-05-12-2016. Not all data is contained in both sets. The weight log was not a daily event for all users. The sleep data is not available for the 03-12-04-11 data. \n\nThe base file, daily activity, contained a unique ID key, activity date, total steps,\ntotal distance, tracker distance, logged activities distance, very active distance, moderately active distance, light active distance, sedentary active distance, very active minutes, lightly active minutes, sedentary active minutes, and calories.\n\nSince this data set was so small, I did the preliminary cleaning in Excel. I standardized the date/time stamp and changed all of the decimal places to 2. Both base files were combined based on dates.\n\nThe hourly files were combined into one hourly file based on the ID.\n\nThe weight log has almost all null values in the fat column, so that was removed. I also removed the is manual binary column and the login ID. The data was cleaned so that the strings were converted to number with two decimal points and the date string was updated. Since this data was daily, it was added back into the base file of daily activities. Since this was a manual entry item, some users had multiple entries and some had none at all. \n\nLeaving me with one base file of daily activities spanning the two-month period. And a second file of hourly activities for the same period.\n\nBoth sets of data contained information for the date 04/12, duplicate information was removed.\n","metadata":{}},{"cell_type":"markdown","source":"# A Summary of my Analysis\nI imported my two cleaned dayasets, Fitbitdata_daily and Fitbitdata_hourly into R.\nI loaded my packages and checked my sample data.","metadata":{}},{"cell_type":"code","source":"#load packages\ninstall.packages(\"tidyverse\")\nlibrary(tidyverse)\nlibrary(dplyr)\nlibrary(lubridate)\nlibrary(ggplot2)\n\n#review data\ndata(Fitbitdata_daily)\nsample(Fitbitdata_daily)\n","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"#I generated an average daily snapshot of activity:\n#average daily activity\nFitbitdata_daily %>%\n  select(TotalSteps,TotalDistance, SedentaryActiveDistance, Calories) %>%\n  summarise(\n    avg_steps = mean(TotalSteps, na.rm = TRUE),\navg_distance = mean(TotalDistance, na.rm = TRUE),\navg_sedentary = mean(SedentaryActiveDistance, na.rm = TRUE),\navg_calories = mean(Calories, na.rm = TRUE)\n)\ndaily_summary <- Fitbitdata_daily %>%\n  summarise(\n    avg_steps = mean(TotalSteps, na.rm = TRUE),\n    avg_distance = mean(TotalDistance, na.rm = TRUE),\n    avg_sedentary = mean(SedentaryActiveDistance, na.rm = TRUE),\n    avg_calories = mean(Calories, na.rm = TRUE)\n  )\n#convert to long format\nlong_summary <- daily_summary %>%\n  pivot_longer(cols = everything(), names_to = \"Activity\", values_to = \"Average\")\n\nprint(long_summary)","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"#plot results\nggplot(long_summary, aes(x = Activity, y = Average, fill = Activity)) +\n  geom_bar(stat = \"identity\", width = 0.6, alpha = 0.8) +  # Bars with transparency\n  labs(title = \"Average Daily Activity Metrics\",\n       x = \"Activity Type\",\n       y = \"Average Value\") +\n  theme_minimal() +  \n  scale_fill_brewer(palette = \"Set2\") + \n  theme(axis.text.x = element_text(angle = 15, hjust = 1, size = 12)) ","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"#I calculated some averages\n# explore number of minutes per category\nactivity %>%\n  select(very_active_minutes, fairly_active_minutes, lightly_active_minutes) %>%\n  summary()\n\n# average calories burned\nFitbitdata_daily %>%\n  select(Calories) %>%\n  summary()\n\n# average steps per day\nFitbitdata_daily %>%\n  select(TotalSteps) %>%\n  summary()\n\n# weight summary\nFitbitdata_daily %>%\n  select(WeightKg,WeightPounds, BMI) %>%\n  summary()","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"#I sumarized which days of the week were the most active\n#active days of the week\nFitbitdata_daily <- Fitbitdata_daily %>%\n  mutate(Date = as.Date(Date, format = \"%Y-%m-%d\")) \nFitbitdata_daily <- Fitbitdata_daily %>%\n  mutate(DayOfWeek = wday(Date, label = TRUE, abbr = FALSE))  \n\nsteps_summary <- Fitbitdata_daily %>%\n  group_by(DayOfWeek) %>%\n  summarise(TotalSteps = sum(TotalSteps, na.rm = TRUE)) %>%\n  arrange(match(DayOfWeek, c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\")))\nprint(steps_summary)\n\n#plot resiults\nggplot(steps_summary, aes(x = DayOfWeek, y = TotalSteps, fill = DayOfWeek)) +\n  geom_bar(stat = \"identity\") +  # Use bars to represent total steps\n  labs(title = \"Total Steps Per Day of the Week\",\n       x = \"Day of the Week\",\n       y = \"Total Steps\") +\n  theme_minimal() + \n  scale_fill_brewer(palette = \"Set3\") \n","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"# And also which times of day were most active using the file with the hourlydata\n#active times perday\nFitbitdata_hourly <- Fitbitdata_hourly %>%\n  mutate(ActivityHour = as.POSIXct(ActivityHour, format = \"%Y-%m-%d %H:%M:%S\"))\nFitbitdata_hourly <- Fitbitdata_hourly %>%\n  mutate(Hour = hour(ActivityHour))  \nhourly_summary <- Fitbitdata_hourly %>%\n  group_by(Hour) %>%\n  summarise(\n    AvgSteps = mean(StepTotal, na.rm = TRUE),\n    AvgCalories = mean(Calories, na.rm = TRUE)\n  ) %>%\n  arrange(Hour)\nprint(hourly_summary)\n\n#plot results\n#plotting for hours\nggplot(hourly_summary, aes(x = Hour, y = AvgSteps)) +\n  geom_point(color = \"blue\", size = 3, alpha = 0.7) +  # Blue dots for steps\n  geom_line(color = \"blue\", linetype = \"dashed\") +  # Dashed line to connect points\n  labs(title = \"Average Steps Per Hour\",\n       x = \"Hour of the Day\",\n       y = \"Average Steps\") +\n  theme_minimal() +\n  scale_x_continuous(breaks = seq(0, 23, by = 1))\n\n#plotting for calories\nggplot(hourly_summary, aes(x = Hour, y = AvgCalories)) +\n  geom_point(color = \"red\", size = 3, alpha = 0.7) +  # Red dots for calories\n  geom_line(color = \"red\", linetype = \"dashed\") +  # Dashed line to connect points\n  labs(title = \"Average Calories Burned Per Hour\",\n       x = \"Hour of the Day\",\n       y = \"Average Calories Burned\") +\n  theme_minimal() +\n  scale_x_continuous(breaks = seq(0, 23, by = 1))\n\n#plot overlay for both\nggplot(hourly_summary, aes(x = Hour)) +\n  geom_point(aes(y = AvgSteps, color = \"Steps\"), size = 3, alpha = 0.7) +\n  geom_line(aes(y = AvgSteps, color = \"Steps\"), linetype = \"dashed\") +\n  geom_point(aes(y = AvgCalories, color = \"Calories\"), size = 3, alpha = 0.7) +\n  geom_line(aes(y = AvgCalories, color = \"Calories\"), linetype = \"dashed\") +\n  labs(title = \"Average Steps & Calories Burned Per Hour\",\n       x = \"Hour of the Day\",\n       y = \"Average Value\",\n       color = \"Metric\") +\n  theme_minimal() +\n  scale_x_continuous(breaks = seq(0, 23, by = 1))","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"# Key Points and Visuals","metadata":{}},{"cell_type":"markdown","source":"The busiest days of the week for fitness activity based on this data are Tuesday and Saturday.\n\nTibble data:\n\n A tibble: 7 × 2\n \n  DayOfWeek TotalSteps\n \n  <ord>          <dbl>\n  \n1 Sunday      1183752 \n\n2 Monday      1315992 \n\n3 Tuesday     1466488.\n\n4 Wednesday   1394770 \n\n5 Thursday    1326413 \n\n6 Friday      1313540 \n\n7 Saturday    1423555 ","metadata":{}},{"cell_type":"markdown","source":"![dayofweek.png](attachment:00059f9e-cc75-4cf5-ba6e-f9562b0baee7.png)","metadata":{},"attachments":{"00059f9e-cc75-4cf5-ba6e-f9562b0baee7.png":{"image/png":""}}},{"cell_type":"markdown","source":"#The average steps and calories per hour:\n\nA tibble: 24 × 3\n\n    Hour AvgSteps AvgCalories\n    \n   <int>    <dbl>       <dbl>\n   \n 1     0    44.0         72.5\n \n 2     1    22.0         70.2\n \n 3     2    13.9         69.0\n \n 4     3     6.96        67.9\n \n 5     4    11.3         68.3\n \n 6     5    34.5         80.3\n \n 7     6   145.          84.0\n \n 8     7   286.          92.8\n \n 9     8   397.         101. \n \n10     9   434.         107. ","metadata":{}},{"cell_type":"markdown","source":"![stepsperhour.png](attachment:5798d7b0-c869-42f1-993b-13932771a594.png)","metadata":{},"attachments":{"5798d7b0-c869-42f1-993b-13932771a594.png":{"image/png":""}}},{"cell_type":"markdown","source":"![caloriesperhour.png](attachment:db7e2fed-3841-4e40-b414-aee757c3c2a3.png)","metadata":{},"attachments":{"db7e2fed-3841-4e40-b414-aee757c3c2a3.png":{"image/png":""}}},{"cell_type":"markdown","source":"![bothperhour.png](attachment:c5fd1300-7e22-4f36-a03a-b69683476665.png)","metadata":{},"attachments":{"c5fd1300-7e22-4f36-a03a-b69683476665.png":{"image/png":""}}},{"cell_type":"markdown","source":"The average activity in a day\nTibble\n\n  Activity         Average\n  <chr>              <dbl>\n  \n1 avg_steps     7340.   \n\n2 avg_distance     5.35   \n\n3 avg_sedentary    0.00171\n\n4 avg_calories  2283.   ","metadata":{}},{"cell_type":"markdown","source":"![daily.png](attachment:2470607d-cc2a-44ed-a97b-9a62688853b2.png)","metadata":{},"attachments":{"2470607d-cc2a-44ed-a97b-9a62688853b2.png":{"image/png":""}}},{"cell_type":"markdown","source":"# Final Recomendations Based on Analysis\n\n Of the 35 users, only 2 were tracking all of their data on a daily basis. Bellabeat should\ntake advantage of the Leaf and Time wellness trackers to send alerts to users to record their \ndaily activity or turn on auto tracking.\n\nThe average steps per day are 7340 whcih is below therecomended 10,000 daily steps for \ngood health. A reminder could also be sent to users to increase their activity.\n\nAn alert could be sent to Spring, the smart water bottle, to encourage more water \nconsumption during the most active times of the day\n\nThe most active days of the week are Tuesday and Saturday. An alert could be sent to increase\nactivity on other days of the week in order to meet fitness goals.","metadata":{}},{"cell_type":"markdown","source":"# Conclusions:\nAlthough this dataset does contain some useful information, I feel that using it for this analysis is a disservice to the shareholders of this company. They are both obviously hands-on owners and I do not feel this is the analysis they are looking for to make descisions about the future growth of their company. I am recommending that additional analysis be done using more expansive data sets that include women's health specifically. I am attaching the dataset \"Workout and Fitness Tracker Dataset\" along with some visuals created in Tableau as a suggestion as to how these avenues could be pursued in the future.","metadata":{}},{"cell_type":"markdown","source":"![tableau.png](attachment:a9131a90-db0f-4bb0-a8bc-3a30647fc592.png)","metadata":{},"attachments":{"a9131a90-db0f-4bb0-a8bc-3a30647fc592.png":{"image/png":""}}}]}